void plot_pixel(int x, int y, short int line_color) {
  volatile short int *one_pixel_address;


  one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);


  *one_pixel_address = line_color;
}

void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)0xff203020;  // base address
  int status;
  *pixel_ctrl_ptr = 1;  // start the synchronization process
  // write 1 into front buffer address register
  status = *(pixel_ctrl_ptr + 3);  // read the status register
  while ((status & 0x01) != 0)     // polling loop waiting for S bit to go to 0
  {
    status = *(pixel_ctrl_ptr + 3);
  }  // loop/function exits when status bit goes to 0
}

void clear_screen() {
  int y, x;


  for (x = 0; x < 320; x++)
    for (y = 0; y < 240; y++) plot_pixel(x, y, 0);
}


void draw_png(unsigned short image[], int x, int y, int width, int height) {
    int s_x, s_y;
    int x_i, y_i;
    for (s_x = 0; s_x < width; s_x++) {
        for (s_y = 0; s_y < height; s_y++) {
            unsigned short pixel_value = image[s_y * width + s_x];
            if (pixel_value != background_color) { // Skip drawing if pixel value matches the background color
                x_i = x + s_x;
                y_i = y + s_y;
                plot_pixel(x_i, y_i, pixel_value);
            }
        }
    }
}

void generate_asteroid(int i){
	
    int side = rand() % 4; // Randomly select one of the four sides (0: top, 1: right, 2: bottom, 3: left)
    switch (side) {
        case 0: // Top edge
            asteroids[i].x = rand() % (size_x - max_a_size - 1);
            asteroids[i].y = 0;
            break;
        case 1: // Right edge
            asteroids[i].x = size_x - max_a_size - 1;
            asteroids[i].y = rand() % (size_y - max_a_size - 1);
            break;
        case 2: // Bottom edge
            asteroids[i].x = rand() % (size_x - max_a_size - 1);
            asteroids[i].y = size_y - max_a_size - 1;
            break;
        case 3: // Left edge
            asteroids[i].x = 0;
            asteroids[i].y = rand() % (size_y - max_a_size - 1);
            break;
    }
    asteroids[i].destroyed = false;
    // Determine movement direction towards the center
    asteroids[i].dx = (size_x / 2 - asteroids[i].x) / (float)(size_x / 2 - asteroids[i].x); // Direction towards the center horizontally
    asteroids[i].dy = (size_y / 2 - asteroids[i].y) / (float)(size_y / 2 - asteroids[i].y); // Direction towards the center vertically
    
    asteroids[i].type = rand() % num_types;  // Randomize the asteroid type

    // Ensure that dx and dy are within the range [-1, 1]
    asteroids[i].dx = (asteroids[i].dx > 1) ? 1 : ((asteroids[i].dx < -1) ? -1 : asteroids[i].dx);
    asteroids[i].dy = (asteroids[i].dy > 1) ? 1 : ((asteroids[i].dy < -1) ? -1 : asteroids[i].dy);

    //Multiply by speed factor
    asteroids[i].dx = asteroids[i].dx*speed;
    asteroids[i].dy = asteroids[i].dy*speed;

}
