void update_asteroid_positions(){

	for (int i = 0; i < num_asteroids; ++i) {
     if (asteroids[i].x + asteroids[i].dx >= 319 - max_a_size || asteroids[i].x + asteroids[i].dx <= 0) {
        // Reverse the direction of motion
        asteroids[i].dx *= -1;
    }
    if (asteroids[i].y + asteroids[i].dy >= 239 - max_a_size || asteroids[i].y + asteroids[i].dy <= 0) {
        // Reverse the direction of motion
        asteroids[i].dy *= -1;
    }


      asteroids[i].x = asteroids[i].x + asteroids[i].dx;
      asteroids[i].y = asteroids[i].y + asteroids[i].dy;
    }
}




void fire_laser() {
    if (num_fired < MAX_LASERS) {
        // Calculate the starting position of the laser
        short int laser_x = (rocket_x) + rocket_width/ 2-(og_laser_width/2); // Center of the rocket horizontally
        short int laser_y = rocket_y; // Top of the rocket vertically
        short int width;
        short int height;

		short int dx=0, dy=0;
    switch (rotation) {
        case 0: // Facing upwards
            dy = -1;
            width = og_laser_width;
            height = og_laser_height;
            break;
        case 45: // 45 degrees
            dx = 1;
            dy = -1;
            width = laser45_width;
            height = laser45_height;
            laser_x = rocket_x + rocket_width/2; // Right side of the rocket horizontally
            laser_y = rocket_y+ rocket_height/2; // Top of the rocket vertically
            break;
        case 90: // Facing right
            dx = 1;
            height = og_laser_width;
            width = og_laser_height;
            laser_x = rocket_x + rocket_width; 
            laser_y = rocket_y + (rocket_height) / 2; 
            break;
        case 135: // 135 degrees
            dx = 1;
            dy = 1;
            width = laser45_width;
            height = laser45_height;
            laser_x = rocket_x + 90/2; 
            laser_y = (rocket_y + 90/2); 
            break;
        case 180: // Facing downwards
            dy = 1;
            width = og_laser_width;
            height = og_laser_height;
            laser_x = rocket_x + (rocket_width-width)/2; 
            laser_y = rocket_y + rocket_height/2; 
            break;
        case 225: // 225 degrees
            dx = -1;
            dy = 1;
            width = laser45_width;
            height = laser45_height;
            laser_x = rocket_x+90/2; 
            laser_y = rocket_y + 90/2; 
            break;
        case 270: // Facing left
            dx = -1;
            height = og_laser_width;
            width = og_laser_height;
            laser_x = rocket_x; 
            laser_y = rocket_y + (rocket_height)/2; 
            break;
        case 315: // 315 degrees
            dx = -1;
            dy = -1;
            width = laser45_width;
            height = laser45_height;
            laser_x = rocket_x-90/2; 
            laser_y = rocket_y-90/2;
            break;
        default: 
            width = og_laser_width;
            height = og_laser_height;
            break;
    }

        // Find an available slot in the lasers array
        int i = 0;
        while (i < MAX_LASERS && lasers[i].fired) {
            i++;
        }

        // If an available slot is found, fire the laser
        if (i < MAX_LASERS) {
            lasers[i].x = laser_x;
            lasers[i].y = laser_y;
            lasers[i].dx = dx; 
            lasers[i].dy = dy; 
            lasers[i].width = width;
            lasers[i].height =height;
            lasers[i].rotation = rotation;
            lasers[i].fired = true;
            num_fired++; // Increment the number of fired lasers
        }
    }
}
void update_laser_positions() {
    for (int i = 0; i < MAX_LASERS; ++i) {
        if (lasers[i].fired) {
            lasers[i].x += lasers[i].dx*laser_speed;
            lasers[i].y += lasers[i].dy*laser_speed;

            // Check if the laser is out of bounds
            if (lasers[i].x < 0 || lasers[i].x+lasers[i].width >= size_x || lasers[i].y < 0 || lasers[i].y+lasers[i].height >= size_y) {
                lasers[i].fired = false; // Set fired to false if laser is out of bounds
				num_fired--;
            }
        }
    }
}

