void display_number(int number) {
    // Calculate the starting position for the top-right corner
    int start_x = size_x - num_width-5; 
    int start_y = 5;
    
    // Display each digit one by one
    while (number > 0) {
        // Extract the last digit of the number
        int digit = number % 10;
        
        // Calculate the position for the current digit
        int x = start_x;
        int y = start_y;
        
        // Draw the current digit
        draw_png(numbers[digit], x, y, num_width, num_height); 
        
        // Update start_x for the next digit
        start_x -= num_width; 
        
        // Remove the last digit from the number
        number /= 10;
    }
}

void show_hex_score(unsigned int value) {

    // Calculate the values for each segment using shifts
    unsigned int hex0to3_value;
    unsigned int hex4to5_value = 0; // Default: Clear HEX4 and HEX5

    unsigned int digit0 = value % 10; //ones
    unsigned int digit1 = (value / 10) % 10; //tens
    unsigned int digit2 = (value / 100) % 10; //hundreds


    // Check if the value exceeds 999
    if (value > 999) {
        hex4to5_value = seg7[(value / 1000) % 10] | (seg7[(value / 10000) % 10] << 8);
        hex0to3_value = seg7[digit0] | (seg7[digit1] << 8) | (seg7[digit2] << 16);
    } else {
        hex0to3_value = seg7[digit0] | (seg7[digit1] << 8) | (seg7[digit2] << 16);
    }

    // Display each digit on respective HEX displays
    hex0to3p->DR = hex0to3_value;
    hex4to5p->DR = hex4to5_value;
}



void set_level(short int level){
    switch (level)
    {
    case 1:
        num_asteroids = 6;
        speed = 1;
        break;
    case 2:
        num_asteroids = 8;
        speed = 1.5;
        break;  
    case 3:
        num_asteroids = 10;
        speed = 2;
        break;
    default:
        break;
    }
}


volatile int *SW_ptr = (int*)0xFF200040;    // address of SWITCHES
void start_game(){
    
    draw_png(start_screen, 0, 0, size_x, size_y);
    int value =  *SW_ptr;

    while (!value){
        value =  *SW_ptr;
        if (value & 1){
            level = 1;
        }
        if (value & 2){
            level = 2;
        }
        if (value & 4){
            level = 3;
        }
    }


         position = 0; //initial position is 0 
         speed_counter = 0;
     prev_position=0;
     right= false; 
     left = false; 
     hit_laser=false;
     enterswitch=true;
      game_over = false;

        audiop->control = 0x8; // clear the output FIFOs
        audiop->control = 0x0; // resume input conversion
      
    lives = 4;
      
	score = 0;

    set_level(level);
	initialize_asteroids();
    play_wamp=false;
}

